import React from 'react';
import ReactDOM from 'react-dom';

function Contributors() {
        let dog = 'dog';
        dog=dog.bold;
        dog=dog.fontcolor("green");
        ReactDOM.render(
        dog,
        document.getElementById('root')
        );
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributors
                </p>
            </header>
        </div>
    );
}

export default Contributors;
